/*Table structure for table `bank_card_modify_record` */

DROP TABLE IF EXISTS `bank_card_modify_record`;

CREATE TABLE `bank_card_modify_record` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `userId` int(10) unsigned NOT NULL COMMENT '申请者用户id',
  `status` smallint(1) unsigned NOT NULL DEFAULT '0' COMMENT '状态码 0:待审批;1:已审批;2:已拒绝;',
  `cardNo` varchar(200) NOT NULL COMMENT '新银行卡号',
  `maskCardNo` varchar(100) DEFAULT NULL COMMENT '自定义加密的银行卡号',
  `bankCode` varchar(3) NOT NULL COMMENT '新银行代码，3位数字，比如102为工行',
  `accountBankName` varchar(64) DEFAULT NULL,
  `accountBankId` varchar(12) DEFAULT NULL,
  `picUrls` varchar(500) NOT NULL COMMENT '图片集合"，"分割',
  `applyTime` datetime NOT NULL COMMENT '申请时间',
  `oldId` varchar(200) NOT NULL COMMENT '原绑定银行卡id',
  `applyStaffId` int(10) DEFAULT NULL COMMENT '申请者id',
  `applyStaffName` varchar(50) DEFAULT NULL COMMENT '申请者名字',
  `auditStaffId` int(10) unsigned DEFAULT NULL COMMENT '审批员工id',
  `auditStaffName` varchar(50) DEFAULT NULL COMMENT '审批者姓名',
  `auditTime` datetime DEFAULT NULL COMMENT '审批时间',
  `comment` varchar(1024) DEFAULT NULL COMMENT '备注:拒绝原因等',
  `bankProvince` varchar(200) DEFAULT NULL COMMENT '省份名称',
  `provinceCode` varchar(200) DEFAULT NULL COMMENT '省份编码',
  `bankCity` varchar(200) DEFAULT NULL COMMENT '城市名称',
  `cityCode` varchar(200) DEFAULT NULL COMMENT '城市编码',
  `bankName` varchar(100) DEFAULT NULL COMMENT '新银行卡名称',
  PRIMARY KEY (`id`)
