/*Table structure for table `bank_info` */

DROP TABLE IF EXISTS `bank_info`;

CREATE TABLE `bank_info` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键Id',
  `bankCode` varchar(3) DEFAULT NULL COMMENT '银行代码',
  `quickCode` varchar(32) DEFAULT NULL COMMENT '银行快捷代码',
  `bankName` varchar(32) DEFAULT NULL COMMENT '银行名称',
  `minLimit` decimal(14,2) DEFAULT NULL COMMENT '最小限额',
  `singleLimit` decimal(14,2) DEFAULT NULL COMMENT '单笔限额',
  `oneDayLimit` decimal(14,2) DEFAULT NULL COMMENT '单日限额',
  `status` smallint(5) unsigned DEFAULT '1' COMMENT '快钱通道状态：0-关闭,1-开启',
  `display` smallint(5) DEFAULT '1' COMMENT '显示规则0不显示1显示',
  `orderIndex` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '排序顺序',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `updateTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_bank_info_bank_name` (`bankName`),
  UNIQUE KEY `unique_bank_info_quickcode` (`quickCode`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8;

