/*Table structure for table `cm_pmsbankno` */

DROP TABLE IF EXISTS `cm_pmsbankno`;

CREATE TABLE `cm_pmsbankno` (
  `PBN_BANKNO` varchar(12) NOT NULL COMMENT '联行号',
  `PBN_BANKTYPE` varchar(3) DEFAULT NULL COMMENT '行别代码',
  `PBN_CITYCODE` varchar(4) DEFAULT NULL COMMENT '所在城市',
  `PBN_BANKNAME` varchar(300) DEFAULT NULL COMMENT '行名全称',
  `PBN_STT` varchar(1) DEFAULT NULL COMMENT '状态',
  `PBN_PARENTNO` varchar(12) DEFAULT NULL COMMENT '上级行号',
  `PBN_TEL` varchar(30) DEFAULT NULL COMMENT '电话',
  `PBN_LSTMODFD` varchar(8) DEFAULT NULL COMMENT '最后修改时间',
  PRIMARY KEY (`PBN_BANKNO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

