/*Table structure for table `user_base` */

DROP TABLE IF EXISTS `user_base`;

CREATE TABLE `user_base` (
  `userId` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户id',
  `openId` varchar(64) DEFAULT NULL COMMENT 'openId',
  `platformType` varchar(20) DEFAULT NULL COMMENT 'platformType',
  `email` varchar(32) DEFAULT NULL COMMENT '邮件，要求唯一',
  `nickName` varchar(32) NOT NULL COMMENT '用户昵称，要求唯一',
  `realName` varchar(16) DEFAULT NULL COMMENT '真实姓名',
  `idCardNo` varchar(18) DEFAULT NULL COMMENT '身份证号',
  `passwd` varchar(32) NOT NULL COMMENT '密码',
  `payPassword` varchar(32) DEFAULT NULL COMMENT '支付密码',
  `mobile` varchar(11) DEFAULT NULL COMMENT '已绑定的手机号码,要求唯一',
  `city` varchar(16) DEFAULT NULL COMMENT '所在城市',
  `registerTime` datetime NOT NULL COMMENT '注册时间',
  `cardVerifyLimit` smallint(5) DEFAULT '0' COMMENT '银行卡绑定重复次数',
  `cardVerifyTime` datetime DEFAULT NULL,
  `idVerifyLimit` smallint(5) unsigned DEFAULT '0' COMMENT '国政通验证次数，每次验证减1，默认每人最多验证3次',
  `realnameVerifyFailureCount` smallint(5) unsigned DEFAULT '0' COMMENT '实名认证失败次数',
  `status` smallint(5) NOT NULL DEFAULT '0' COMMENT '用户状态。',
  `recommended` varchar(64) DEFAULT NULL COMMENT '推荐人',
  `portrait` int(10) DEFAULT NULL COMMENT '头像id',
  `bankCardModifyCount` smallint(5) unsigned DEFAULT '0' COMMENT '银行卡修改次数',
  `lastLockedTime` datetime DEFAULT NULL COMMENT '最新的锁定时间',
  `amountVerifyLimit` smallint(5) DEFAULT '0' COMMENT '金额验证重复次数',
  `amountVerifyTime` datetime DEFAULT NULL COMMENT '金额验证时间',
  `channel` varchar(1) DEFAULT '0' COMMENT '渠道(0：PC；1：安卓客户端；2：ios客户端；3：转赚)',
  `subChannel` varchar(8) DEFAULT NULL COMMENT '子渠道',
  `invitationCode` varchar(64) DEFAULT NULL COMMENT '邀请码',
  `headImgUrl` varchar(500) DEFAULT NULL COMMENT '用户头像',
  `riskLevel` smallint(1) NOT NULL DEFAULT '1' COMMENT '用户风险等级',
  `userType` smallint(1) DEFAULT NULL,
  PRIMARY KEY (`userId`),
  UNIQUE KEY `user_base_nickName` (`nickName`),
  UNIQUE KEY `user_base_email` (`email`),
  UNIQUE KEY `user_base_mobile` (`mobile`),
  UNIQUE KEY `user_base_invitationCode` (`invitationCode`) USING BTREE,
  UNIQUE KEY `openId_platform` (`openId`,`platformType`)
) ENGINE=InnoDB AUTO_INCREMENT=6000401 DEFAULT CHARSET=utf8;

