/*Table structure for table `wx_info` */

DROP TABLE IF EXISTS `wx_info`;

CREATE TABLE `wx_info` (
  `open_id` varchar(128) NOT NULL COMMENT '微信ID',
  `platformType` varchar(20) DEFAULT NULL COMMENT 'platformType',
  `bind_mobile` varchar(11) DEFAULT NULL COMMENT '绑定的手机号',
  `nick_name` varchar(64) DEFAULT NULL COMMENT '微信呢称',
  `sex` varchar(1) DEFAULT NULL COMMENT '性别',
  `province` varchar(12) DEFAULT NULL COMMENT '省份',
  `city` varchar(12) DEFAULT NULL COMMENT '城市',
  `country` varchar(80) DEFAULT NULL COMMENT '国家',
  `union_id` varchar(64) DEFAULT NULL,
  `head_img_url` varchar(300) DEFAULT NULL COMMENT '头像图片地址',
  `invitationCode` varchar(64) DEFAULT NULL COMMENT '邀请码',
  PRIMARY KEY (`open_id`),
  UNIQUE KEY `wx_info_open_id` (`open_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

